import React from 'react'
import styled from 'styled-components'
import HeaderImage from 'Static/header.png'
import { Link } from 'react-router-dom';
import { Formik, Field, Form } from "formik";

const Header = styled.section`
    width: 100%;
    height: 100vh;
    background-repeat: no-repeat, repeat;
    background-position: bottom;
    background-size: cover;
    background-image: url(${HeaderImage});
`;

const Content = styled.div`
    position: absolute;
    left: 50%;
    top: 50%;
    -webkit-transform: translate(-50%, -50%);
    transform: translate(-50%, -50%);  
`;

const Page = styled.div`
    width: 100%;
    height: 100%;
    background-image: url("data:image/jpeg;base64,");
    background-repeat: no-repeat;
    background-position: center;
    background-size: cover;
`;

function Register() {
    return (
        <Page>
            <Header>
                <Content>
                    <div className="flex min-h-full items-center justify-center py-12 px-4 sm:px-6 lg:px-8">
                        <div className="w-full max-w-md space-y-8">
                            <div>
                                <h2 className="mt-6 text-center text-3xl font-bold tracking-tight text-gray-200">
                                    Register a user account
                                </h2>
                                <p className="mt-2 text-center text-sm text-gray-200 font-bold">
                                Or{' '}
                                <Link to={"/"} className="font-bold text-[#feb0bd]">
                                    return to the main page
                                </Link>
                                </p>
                            </div>
                            <Formik
                                initialValues={{ name: "", email: "" }}
                                onSubmit={async (values) => {
                                await new Promise((resolve) => setTimeout(resolve, 500));
                                alert(JSON.stringify(values, null, 2));
                                }}
                            >
                                <Form>
                                <div>
                                    <label htmlFor="email-address" className="sr-only">
                                    Email address
                                    </label>
                                    <input
                                    id="email-address"
                                    name="email"
                                    type="email"
                                    autoComplete="email"
                                    required
                                    className="relative block w-full appearance-none rounded-none rounded-t-md border border-gray-300 px-3 py-2 text-gray-900 placeholder-gray-500 focus:z-10 focus:border-indigo-500 focus:outline-none focus:ring-indigo-500 sm:text-sm"
                                    placeholder="Email address"
                                    />
                                </div>
                                    <div>
                                        <label htmlFor="password" className="sr-only">
                                        Password
                                        </label>
                                        <input
                                        id="password"
                                        name="password"
                                        type="password"
                                        autoComplete="current-password"
                                        required
                                        className="relative block w-full appearance-none rounded-none rounded-b-md border border-gray-300 px-3 py-2 text-gray-900 placeholder-gray-500 focus:z-10 focus:border-indigo-500 focus:outline-none focus:ring-indigo-500 sm:text-sm"
                                        placeholder="Password"
                                        />
                                </div>
                                    <button
                                    type="submit"
                                    className="group relative flex w-full justify-center rounded-md border border-transparent bg-indigo-600 py-2 px-4 text-sm font-medium text-white hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-indigo-500 focus:ring-offset-2"
                                >
                                    <span className="absolute inset-y-0 left-0 flex items-center pl-3">
                                    
                                    </span>
                                    Sign in
                                </button>
                                </Form>
                            </Formik>
                            <form className="mt-3 space-y-2" action="#" method="POST">
                                <input type="hidden" name="remember" defaultValue="true" />
                                <div className="-space-y-px rounded-md shadow-sm">
                                
  
                                </div>

                                
                            </form>
                        </div>
                    </div>
                </Content>
            </Header>
        </Page>
    );
}

export default Register;
